(2,'terms and conditions','terms_and_conditions','<p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">Please read the terms and conditions (\"Terms and Conditions\") set out below carefully before ordering any Goods or Services from this Website. By ordering any Goods or Services from this Website, by phone, or by our mobile applications you agree to be bound by these Terms and Conditions.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">INTRODUCTION :</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">We are BHUKKAS, a brand of http://www.bhukkas.com, unless otherwise stated.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">1 - Scope of Agreement</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">During the term of this Agreement, CLIENT or CLIENT’s affiliated companies may acquire services from BHUKKAS by means of a Work Authorization subject to the terms and conditions of this Agreement.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">2 - Work Authorization</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">2.1 Each Work Authorization shall be issued in accordance with Article 3 of this Agreement. Each Work Authorization shall contain the following information:</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">(a) a description of the services to be performed (including deliverables, if any) !&nbsp;<br style=\"outline: none;\">(b) the period of performance !&nbsp;<br style=\"outline: none;\">(c) the place of performance !&nbsp;<br style=\"outline: none;\">(d) the performance and delivery schedule:&nbsp;<br style=\"outline: none;\">(e) the Work Authorization price, including billable labor rates and expenses !&nbsp;<br style=\"outline: none;\">(f) for Time and Material Work Authorizations, labor categories and associated levels of effort, and a funding limitation in accordance with Article 4 of this Agreement. !<br style=\"outline: none;\">(g) for Firm Fixed Price Work Authorizations, the maximum payment obligation of CLIENT !&nbsp;<br style=\"outline: none;\">(h) description of expenses to be reimbursed by CLIENT incurred by BHUKKAS in the performance of the Work Authorization services !&nbsp;<br style=\"outline: none;\">(i) such additional terms and conditions as may be agreed to by the parities.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">2.2 All Work Authorizations shall be signed by a duly authorized representative of BHUKKAS, and shall be subject to acceptance by an authorized representative of CLIENT. Nothing contained in this Agreement shall obligate CLIENT to accept any Work Authorization or pay for services provided or expenses incurred by BHUKKAS in the absence of CLIENT’s prior acceptance of a Work Authorization in accordance with this paragraph.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">2.3 All Work Authorization shall be subject to the terms and conditions of this Agreement. This Agreement and each individual Work Authorization comprise a contract between BHUKKAS and CLIENT. In the event of a conflict between the terms of this Agreement and the terms of a Work Authorization, the terms of the Work Authorization shall govern.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">2.4 The terms and conditions of any past document of BHUKKAS, that are additional to or different from the terms or conditions of this Agreement and the relevant Work Authorization, shall be void.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">3 - Initiation of Work Authorizations</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">The following procedure shall be followed to initiate a Work Authorization under this Agreement: (a) BHUKKAS shall prepare a Work Authorization in duplicate and submit the form together with any attachments to CLIENT and ! (b) CLIENT shall execute the Work Authorizations in the space provided and return one (1) fully executed copy to BHUKKAS.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">4 - Work Authorization Funding Limitations</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">4.1 Time and Material-CLIENT shall pay BHUKKAS only in accordance with the billable rates and expenses set forth in the Work Authorization, and shall not be liable for payments in excess of the funding limitations set forth in the Work Authorization. BHUKKAS shall not be obligated to provide, and CLIENT shall not be obligated to pay for services beyond the period of performance in excess of the total funding limitation specified in a Time and Materials Work Authorization.&nbsp;<br style=\"outline: none;\">4.2 Firm Fixed Price-CLIENT shall not be obligated to pay BHUKKAS for costs incurred by BHUKKAS in excess of the Firm Fixed Price set forth in the Firm Fixed Price Work Authorization. BHUKKAS shall be solely responsible for costs incurred by BHUKKAS in excess of the Firm Fixed Price.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">5 – Changes</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">CLIENT or BHUKKAS may request changes in the scope of work or deliverables specified in a Work Authorization. Upon agreement between the parties as to the change and associated price, CLIENT shall initiate an amendment to the existing Work Authorization in accordance with Article 3 of this Agreement. BHUKKAS shall be solely responsible for any changed services performed in the absence of a duly executed amendment to the Work Authorization.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">6 - Terms and Termination</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">6.1 The term of this Agreement shall commence on the date this Agreement is accepted by CLIENT, and shall continue until terminated by either party upon written notice received by the other party not less than thirty (30) days prior to the intended date of termination. Unless termination is for reasons of material breach, termination of this Agreement by either party shall not be effective, with respect to any Work Authorization in process, until such Work Authorization expire or are expressly terminated in writing by CLIENT. CLIENT reserves the right to terminate any Work Authorization upon written notice received by the BHUKKAS not less than five (5) working days prior to the intended date of termination. !&nbsp;<br style=\"outline: none;\">6.2 In addition to any other lawful remedy, either party may terminate this Agreement or any Work Authorization in the event of breach of a material term of this Agreement or any Work Authorization by the other party, which breach is not cured within thirty (30) days from receipt of written notice. The foregoing thirty (30) day cure period shall not apply in the event of breach of the Confidential and Proprietary Information, Rights in Data, Interests, or Title provision(s) contained in this Agreement or in a Work Authorization, which event shall entitle the non-breaching party to immediately terminate this Agreement and all Work Authorizations upon written notice to the breaching party. !&nbsp;<br style=\"outline: none;\">6.3 Articles 9, 10, 11, 12, 13, 14, 15, 20 and 21 shall survive termination of this Agreement.&nbsp;<br style=\"outline: none;\">6.4 On the effective date of termination of a Work Authorization, BHUKKAS shall return to CLIENT all CLIENT Confidential and Proprietary Information for which CLIENT has not granted to BHUKKAS a separate, specific license for continued use, and CLIENT shall return to BHUKKAS all BHUKKAS Confidential and Proprietary Information for which BHUKKAS has not granted to CLIENT a separate, specific license for continued use.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">7 – Taxes</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">In the event any taxes based upon this Agreement or any Work Authorization placed pursuant to this Agreement, other than corporate franchise taxes and taxes based on BHUKKAS’s net income, are payable or paid by BHUKKAS, such amount shall be added to the charges due BHUKKAS and shall be paid by CLIENT to BHUKKAS. However, CLIENT shall not be required to pay those taxes from which CLIENT is legally exempt.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">8 - Retainers, Invoices and Payment</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">Retainers are required on all Work Authorizations unless otherwise state in the Work Authorization. The Retainer is to be paid in an amount stated in the Work Authorization. Retainers are to be paid at time of issuance of Work Authorization(s). Time and Material Authorization, BHUKKAS shall submit invoices semi-monthly (on the first and fifteenth of each month) for services rendered during the preceding period, unless otherwise stated in the Work Authorization. For Firm Fixed Price Work Authorizations, BHUKKAS shall submit invoices in accordance with the payment schedule contained in the Work Authorization. Each invoice shall reference the applicable Work Authorization, and shall include supporting detail and documentation for all charges. All amounts are due and payable in U.S. dollars within ten calendar days from delivery to CLIENT of a proper invoice.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">9 - Confidential and Proprietary Information</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">9.1 The parties agree that during the terms of this Agreement, it may be necessary for the parties to exchange Confidential and Proprietary Information during the performance of a Work Authorization.&nbsp;<br style=\"outline: none;\">9.2 \"Confidential Information\" as used herein shall mean all technical and business information identified by the disclosing party as confidential prior to disclosure, except such information which:&nbsp;<br style=\"outline: none;\">(a) is in the receiving party’s possession, without an obligation of confidentiality with respect thereto, prior to disclosure under this Agreement;&nbsp;<br style=\"outline: none;\">(b) is or subsequently becomes part of the public domain through no act or omission of the receiving party;&nbsp;<br style=\"outline: none;\">(c) is disclosed to the receiving party by a third party having no obligation of confidentiality with respect thereto;&nbsp;<br style=\"outline: none;\">(d) is disclosed to the receiving party by a third party having an obligation of confidentiality thereto, provided the receiving party did not have notice that such information was wrongfully disclosed by such third party; or&nbsp;<br style=\"outline: none;\">(e) is independently developed by the receiving party. The parties agree that CLIENT and BHUKKAS client data and services constitute Confidential Information of CLIENT and BHUKKAS respectively for the purposes of this Agreement. The disclosing party reserves all rights and interests in Confidential Information.&nbsp;<br style=\"outline: none;\">9.3 \"Proprietary Information\" as referred to herein means the disclosing party’s software products, related documentation and training materials. The disclosing party reserves all rights and interests in Proprietary Information. The receiving party acknowledges that software products and related documentation constitute proprietary information, which include copyrighted and trade secret information of the disclosing party.<br style=\"outline: none;\">9.4 In consideration for the disclosure of Confidential or Proprietary Information by the disclosing party, the receiving party shall use reasonable means not less than those used to protect its own Confidential or Proprietary Information of a similar nature and value, to:&nbsp;<br style=\"outline: none;\">(a) restrict use of, and access to, Confidential and Proprietary Information to employees and any other duly authorized agents need-to-know basis only;&nbsp;<br style=\"outline: none;\">(b) take appropriate action, by instruction, agreement, or otherwise, to advise those employees who receive Confidential or Proprietary Information of its confidential and proprietary nature;<br style=\"outline: none;\">(c) prevent disclosure or reproduction of, or access to, Confidential or Proprietary Information to, or by, any third party;&nbsp;<br style=\"outline: none;\">(d) use Confidential or Proprietary Information only in accordance with the relevant Work Authorization unless permission has first been obtained from the disclosing party for such other use; and&nbsp;<br style=\"outline: none;\">(e) reproduce the other party’s Confidential or Proprietary Information only as necessary for the receiving party’s authorized use in accordance with the relevant Work Authorization.<br style=\"outline: none;\">9.5 The Receiving party shall return all Confidential or Proprietary Information, including any sole or partial copies thereof; immediately upon written demand by the disclosing party.<br style=\"outline: none;\">9.6 Neither party shall have any obligation with respect to Confidential Information after the lapse of one (1) year from the date such Confidential Information is returned to the disclosing party.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">10 – Indemnification</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">CLIENT agrees to indemnify and hold harmless BHUKKAS, and its subcontractors, from and against all claims, damages, expenses or liabilities to third parties resulting from BHUKKAS’s use or distribution of information, representations, reports or data which has been approved in writing or furnished by CLIENT, to the extent that such material is used or distributed by BHUKKAS and such claim or loss is not due to BHUKKAS’s gross negligence. BHUKKAS will be similarly indemnified by CLIENT against any claims made by third parties arising from claims unrelated to the services provided by BHUKKAS under this Agreement (e.g., frivolous or attached third-party suits.) CLIENT must be informed in advance of any claim before legal fees or other costs are incurred, and will have the option to provide a defense to the claim or approve the action that BHUKKAS proposes.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">11 - Non-Competition</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">CLIENT and BHUKKAS recognize that each has independently developed relationships with the CLIENT operations management customer base. CLIENT and BHUKKAS recognizes that each regularly promotes its CLIENT related services through its own internally developed and maintained proprietary customer list. During the period of performance of a Work Authorization, BHUKKAS will not directly or indirectly compete with CLIENT for any work which was performed under a Work Authorization or which is directly related to any Work Authorization executed by CLIENT and BHUKKAS pursuant to this Agreement.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">12 - Inspection and Acceptance - Customer Satisfaction</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">All services and deliverables under a Work Authorization shall be subject to inspection and acceptance by CLIENT within **** business days/HOURS of delivery by BHUKKAS. Any inspection by CLIENT shall be performed in such a manner as not to unduly delay the work. CLIENT will notify BHUKKAS, in writing, of any non-compliance with the specifications of the Work Authorization, and BHUKKAS shall have ten (10) business days to correct the reported non-compliance and to resubmit the item to CLIENT.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">13 - Subcontracts and Assignments</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">Neither BHUKKAS and CLIENT may assign its rights or delegate its duties described in this Agreement without prior written approval. BHUKKAS and CLIENT shall remain responsible for the performance of delegated duties</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">ARTICLE 20 – Warranties--14. BHUKKAS warrants that</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">(a) its consulting services will be of the professional quality and will conform to generally accepted consulting standards;&nbsp;<br style=\"outline: none;\">(b) its personnel shall be competent and qualified to perform the tasks to which they are assigned; and&nbsp;<br style=\"outline: none;\">(c) will make best effort to perform all duties specified in Work Authorizations</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">15 - Limitation of Liability</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">15.1 CLIENT’s liability for payment and direct damages, regardless of the form of action, shall not exceed the funding limitation for the applicable services specified in the Work Authorization which gave rise to the claim.<br style=\"outline: none;\">15.2 The limitations of liability stated in Paragraph 21.1 shall not apply to personal injury or damage to CLIENT or BHUKKAS’s real or tangible personal property directly caused by CLIENT’s or BHUKKAS’s negligence. \"Tangible personal property\" includes computer software, computer data or data files.<br style=\"outline: none;\">15.3 IN NO EVENT SHALL CLIENT OR BHUKKAS BE RESPONSIBLE FOR ANY LOST PROFITS, LOST SAVINGS, INCIDENTAL, INDIRECT, SPECIAL, OR CONSEQUENTIAL DAMAGES.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">16 – JURIDICTION</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">This Agreement shall be governed and construed in accordance with the laws of the Indore City.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">17 – ARBITTRATION</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">The parties agree that the most appropriate forum for the resolution of any disputes arising under this Agreement is binding arbitration.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">18 - General</span></p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\">18.1 BHUKKAS agrees not to use, in advertising, publicity or otherwise, any trademark of CLIENT without prior written permission.&nbsp;<br style=\"outline: none;\">18.2 This Agreement may not be waived, altered, or modified except by a written agreement signed by CLIENT and BHUKKAS and accepted by an authorized representative of CLIENT and BHUKKAS.&nbsp;<br style=\"outline: none;\">18.3. No delay or failure of either party in exercising any right and no partial or single exercise of any right shall be deemed to constitute a waiver of that right or any other rights under this Agreement. No action arising out of this Agreement, regardless of form, may be brought by either party more than one year after the cause of action has accrued.&nbsp;<br style=\"outline: none;\">18.4 The captions used in this Agreement are for convenience only and are not intended to have nay legal effect.&nbsp;<br style=\"outline: none;\">18.5 If any provision, or portion thereof, of this Agreement is invalid or unenforceable under any applicable statute or rule of law, it is to that extent to be deemed omitted.</p><p style=\"outline: none; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 13px; color: rgb(102, 102, 102);\"><span style=\"outline: none; font-weight: 700; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit;\">The parties have read this Agreement and agree to be bound by all its terms. The parties agree that there are no conditions precedent. The parties further agree that this Agreement, Schedule I hereto and the Work Authorization(s) constitute the complete and exclusive statement of the agreement between them and supersede all proposals, oral or written, all other communications between them relating to the terms and conditions of this Agreement and the Work Authorization(s).</span></p>','2016-06-08 15:37:41','0000-00-00 00:00:00');

